import Layout from "../components/layout/layout";

function Udashboard() {
  return (
    <Layout>
      <Topbar />
    </Layout>
  );
}

function Topbar() {
  const position = { container: "" };
  return <div className={position.container}></div>;
}

export default Udashboard;
